import React from 'react';

export default function ParticipantListTable(props) {
  const { participantList } = props;
  return (
    <div className="table-responsive">
      <table className="display dtable w-100" >
        <thead>
          <tr>
            <th>S.No</th>
            <th>USER ID</th>
            <th>ATTEMPTED DATE</th>
            <th>SCORE</th>
          </tr>
        </thead>
        <tbody>
          <TableBody
            data={participantList}
          />
        </tbody>
      </table>
    </div>
  )
}

function TableBody(props) {

  const { data } = props;
  if (data.length > 0) {
    return data.map((participant, index) => (
      <tr key={index}>
        <td>{index + 1}</td>
        <td>{participant.user_id}</td>
        <td>-</td>
        <td>-</td>
      </tr>
    ));

  }
  return (
    <tr>
      <td colSpan="4">No Data</td>
    </tr>
  )

}
